create table sys_log_operate
(
    id            bigint auto_increment comment '编号'
        primary key,
    title         varchar(255)                 default ''                   null comment '日志标题',
    log_type      varchar(255)                                              null comment '日志类型',
    username      varchar(255)                                              null comment '用户名',
    service_id    varchar(32)                                               null comment '服务ID',
    ip_address    varchar(255)                                              null comment 'IP地址',
    ip_location   varchar(255) charset utf8mb4 default ''                   null comment '登录地点',
    browser       varchar(50) charset utf8mb4  default ''                   null comment '浏览器类型',
    os            varchar(50) charset utf8mb4  default ''                   null comment '操作系统',
    user_agent    varchar(1000)                                             null comment '用户代理',
    request_uri   varchar(255)                                              null comment '请求URI',
    method        varchar(255)                                              null comment '请求方法',
    params        text                                                      null comment '操作提交的数据',
    time          mediumtext                                                null comment '执行时间',
    operator_type varchar(20)                  default '0'                  null comment '操作类别（0其它 1后台用户 2手机端用户）',
    business_type varchar(20)                  default '0'                  null comment '业务类型（0其它 1新增 2修改 3删除）',
    exception     text                                                      null comment '异常信息',
    created_by    varchar(64)                                               null comment '创建者',
    created_date  timestamp(3)                 default CURRENT_TIMESTAMP(3) null comment '创建时间',
    description   varchar(100)                                              null comment '描述',
    del_flag      char collate utf8mb4_bin     default '0'                  null comment '0-正常，1-删除'
)
    comment '操作日志表' charset = utf8;

create index sys_log_create_by
    on sys_log_operate (created_by);

create index sys_log_create_date
    on sys_log_operate (created_date);

create index sys_log_request_uri
    on sys_log_operate (request_uri);

